INSERT INTO `f_post` VALUES (1,1,'1068310406818304000','0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-12-20 16:21:51',1,'Hello','2018-12-24 14:35:24','1'),(2,1,'1068310406881218560','1','images/unsplash_1.jpg','images/unsplash_1.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-11-21 09:05:43',1,'立冬以来，由于太阳的偷懒，日子一天比一天冷。傍晚五点，行人变得朦胧，不调整瞳孔是看不清人的模样。 “老逼！”一个少妇的声音打断我的思路。 天啊，肯定会有熟悉我的人在心里大叫，你也么会写出这样的脏话？是的，在说脏话成口头禅的儿时我就从不说脏话，何况当下的文明时代。也恰在高唱文明的进步社会，网络上变异的脏话常咯着我的眼。还有相信迷信的人也多了，例如高考的家长、污点官员等，社会是在退步还是进步，我迷茫了。 可是这天傍晚，朦胧的街边，我耳朵听到的就是这音调，通过大脑几十年存储的大数据分析出来就是这两个字。 “唉！”一位发福的中年妇女，身形好似水桶，无意中被少妇一喊开心地笑应。 看她们彼此的热情','2018-12-24 14:35:23','人间过客'),(3,1,'1068310406881218560','2',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'images/video/demo.mp4','2018-12-21 09:06:30',1,'<p style=\'color:red\'>Hi3</p>','2018-12-24 14:35:22','3'),(4,1,'1068310406881218560','0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-12-24 14:35:24',1,'1','2018-12-24 14:35:21','4'),(5,1,'1068310406881218560','0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-12-24 14:35:24',1,'2','2018-12-24 14:35:20','5'),(6,1,'1068310406881218560','0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-12-24 14:35:24',1,'3','2018-12-24 14:35:19','6'),(7,1,'1068310406881218560','0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-12-24 14:35:24',1,'4','2018-12-24 14:35:18','7'),(8,1,'1068310406881218560','0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-12-24 14:35:24',1,'5','2018-12-24 14:35:17','8'),(9,1,'1068310406881218560','0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-12-24 14:35:24',1,'6','2018-12-24 14:35:16','9'),(10,1,'1068310406881218560','0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-12-24 14:35:24',1,'7','2018-12-24 14:35:15','10'),(11,1,'1068310406881218560','0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-12-24 14:35:24',1,'8','2018-12-24 14:35:14','11'),(12,1,'1068310406881218560','0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-12-24 14:35:24',1,'9','2018-12-24 14:35:13','12'),(13,1,'1068310406881218560','0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-12-24 14:35:24',1,'10','2018-12-24 14:35:12','13'),(14,1,'1068310406881218560','0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-12-24 14:35:24',1,'11','2018-12-24 14:35:11','14'),(15,1,'1068310406881218560','0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-12-24 15:35:37',1,'12','2018-12-24 14:35:25','0');
